// AdminDashboard.js
import React, { useState, useEffect } from "react";
import axios from "axios";
import "./Admin.module.css";

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [email, setEmail] = useState("");
  const [name, setName] = useState("");
  const [progress, setProgress] = useState(0);
  const [selectedUser, setSelectedUser] = useState(null);

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const response = await axios.get("http://localhost:2885/api/admin/users");
      setUsers(response.data);
    } catch (error) {
      console.error("Error fetching users:", error);
    }
  };

  const handleAddUser = async () => {
    try {
      const newUser = { email, name, progress };
      await axios.post("http://localhost:2885/api/admin/add", newUser);
      fetchUsers();
      setEmail("");
      setName("");
      setProgress(0);
    } catch (error) {
      console.error("Error adding user:", error);
    }
  };

  const handleDeleteUser = async (id) => {
    try {
      await axios.delete(`http://localhost:2885/api/admin/user/${id}`);
      fetchUsers();
    } catch (error) {
      console.error("Error deleting user:", error);
    }
  };

  const handleViewUser = async (email) => {
    try {
      const response = await axios.get(`http://localhost:2885/api/admin/user/${email}`);
      setSelectedUser(response.data);
    } catch (error) {
      console.error("Error fetching user:", error);
    }
  };

  return (
    <div className="admin-dashboard">
      <h2>Admin Dashboard</h2>
      <div className="add-user-form">
        <h3>Add User</h3>
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <input
          type="text"
          placeholder="Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <input
          type="number"
          placeholder="Progress"
          value={progress}
          onChange={(e) => setProgress(Number(e.target.value))}
        />
        <button onClick={handleAddUser}>Add User</button>
      </div>
      <div className="user-list">
        <h3>User List</h3>
        <ul>
          {users.map((user) => (
            <li key={user.id}>
              {user.name} ({user.email}) - Progress: {user.progress}
              <button onClick={() => handleDeleteUser(user.id)}>Delete</button>
              <button onClick={() => handleViewUser(user.email)}>View</button>
            </li>
          ))}
        </ul>
      </div>
      {selectedUser && (
        <div className="user-details">
          <h3>User Details</h3>
          <p>ID: {selectedUser.id}</p>
          <p>Name: {selectedUser.name}</p>
          <p>Email: {selectedUser.email}</p>
          <p>Progress: {selectedUser.progress}</p>
        </div>
      )}
    </div>
  );
};

export default AdminDashboard;
